import React from "react";
import Header from "./../components/Header";

const headerStyle = {
  backgroundColor: '#FFE600',
  color: '#999999 !important',
  maxWidth: '1200px',
  margin: '0',
  padding: '7px'
};

const Home = () => {
  return (
    <>
      <Header style={headerStyle} />
    </>
  );
};

export default Home;
